const SUBMIT_FORM_URL="https://us-west2-riverviewfarm.cloudfunctions.net/send-contact-email";$(window).on("load",function(){$("#status").delay(300).fadeOut(),$("#preloader").delay(300).fadeOut("slow"),$("body").delay(550).css({overflow:"visible"})}),window.onscroll=function(){myFunction()};var navbar=document.getElementById("navbar"),sticky=navbar.offsetTop;function myFunction(){window.pageYOffset>=sticky?navbar.classList.add("sticky"):navbar.classList.remove("sticky")}$("#contact-form").on("submit",function(e){const s=$("#contact-form").serializeJSON();e.preventDefault(),$.ajax({type:"POST",processData:!1,url:SUBMIT_FORM_URL,crossDomain:!0,contentType:"application/json; charset=utf-8",data:JSON.stringify(s),success:function(e){$("#contact-form").trigger("reset"),alert("Thank you! Your message has been successfully sent.")},error:function(e){console.log(e.status),console.log(e.responseText),alert(`Oops! There was a problem sending your message. ${e.status}: ${e.responseText}`)}})});